function App() {
  return (
    <>
      <Header />
      <Menu />
      <Sidebar />
      <Content />
      <Footer />
    </>
  );
}

function Header() {
  return <h1>Header</h1>;
}

function Menu() {
  return <nav>Menu</nav>;
}

function Sidebar() {
  return <aside>Aside</aside>;
}

function Content() {
  return <section>Content</section>;
}

function Footer() {
  return <footer>Footer</footer>;
}

export default App;
